      <table className="table">
        <thead>
          <tr>
            <th><abbr title="Position">Name</abbr></th>
            <th>Handle</th>
            <th><abbr title="Played">Priority Queue</abbr></th>
            <th><abbr title="Played">Score</abbr></th>
            <th><abbr title="Won">Application Date</abbr></th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <th>Table Header</th>
            <td>
              <a href="https://en.wikipedia.org/wiki/Leicester_City_F.C." title="Leicester City F.C.">Leicester City</a>
              {' '}
              <strong>(C)</strong>
            </td>
            <td>38</td>
            <td>23</td>
            <td>12</td>
            <td>3</td>
            <td>68</td>
            <td>36</td>
            <td>+32</td>
            <td>81</td>
            <td>
              Qualification for the
              <a href="https://en.wikipedia.org/wiki/2016%E2%80%9317_UEFA_Champions_League#Group_stage" title="2016â€“17 UEFA Champions League">Champions League group stage</a>
            </td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

const ApplicantDetailedInfo = () => {
  console.log('ApplicantDetailedInfo');
